const UpdateLiveStats = (props) => {

  const convertedTime = new Date(props.lastUpdatedTime).toDateString()
  console.log(convertedTime)

  return (
    <div>
      <div>
        <p className="text-muted">Updated AT {props.lastUpdatedTime}</p>
      </div>
    </div>
  );
};

export default UpdateLiveStats;
